"use strict";
Page({
    data: {
        tempImgFilePath: [],
    },
    saveFile: function () {
        var _this = this;
        wx.chooseImage({
            count: 1,
            success: function (res) {
                _this.setData({ tempImgFilePath: res.tempFilePaths });
                wx.saveVideoToPhotosAlbum({
                    filePath: _this.data.tempImgFilePath[0],
                    success: function (res) {
                        wx.showToast({ title: "保存成功了" });
                    },
                });
            },
        });
    },
    getSaveFileList: function () {
        wx.getSavedFileList({
            success: function (res) {
                console.log(res);
                wx.getFileInfo({
                    filePath: res.fileList[0].filePath,
                    success: function (res) {
                        console.log(res);
                    },
                });
            },
        });
    },
});
